def main():
    num = float(input())
    if num < 1 or num >= 5:
        print("Invalid input")
        return

    # Find two numbers
    for i in range(10, 0, -1):
        for j in range(10, 0, -1):
            if i + j == num:
                print("{} {}".format(i, j))
                return

if __name__ == '__main__':
    main()

from math import floor
x = float(input())
floor_x = floor(x)

a = floor_x + 1
b = floor_x + 2

for i in range(10):
    if i*a > 10:
        break
    for j in range(10):
        if i*a + j*b == floor(10*x):
            print(i, j)
            exit()
